contracts/Product.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity 0.8.18;

import "./Handshaker.sol";

contract Product is Handshaker{
    

    bool IsValue;
    string Name;

    string Ipfs_Address;

    uint CarbonFootprint;

    string Swarm_storage_address;
    
    mapping(uint256 => Product) public products;
    mapping(address => uint256[]) public userProducts;


    constructor(string memory _name, uint _carbonFootprint, address _owner) {
        Owner = _owner;
        Name = _name;
        CarbonFootprint = _carbonFootprint;
        IsValue= true;

    }
    //region setter functions
    function Set_Name(string calldata new_name) public onlyOwner{
        Name = new_name;
    }
    //SUPPLYCHAIN CONTRACT BECOMES TOO BIG IF THIS WAY OF OWNERSHIP TEST GETS IMPLEMENTED:
    // function Set_Name(string calldata new_name, address _owner) public onlyOwner{
    //     require(instance.Owner == _owner, "Sender is not the owner of this product" );
    //     instance.Name = new_name;
    // }

    

    function Set_CarbonFootPrint(uint new_CarbonFootprint) public onlyOwner{
        CarbonFootprint = new_CarbonFootprint;
    }

    function Set_IsValue(bool value) public onlyOwner{
        IsValue = value;
    }

    function Set_IPFS(string calldata _ipfsAddress) public onlyOwner{
        Ipfs_Address = _ipfsAddress;
    }
    //endregion setter functions

    //region getter functios
    function Get_Successor_Count() external view returns(uint256){
        return Ids[relation.SUCCESSOR].length;
    }

    function Get_Predecessor_Count() external view returns(uint256){
        return Ids[relation.PREDECESSOR].length;
    }

    function Get_Predecessors() external view returns(address[] memory){
        return Ids[relation.PREDECESSOR];
    }
    function Get_Successors() external view returns(address[] memory){
        return Ids[relation.SUCCESSOR];
    }
    function Get_LabelIDs() external view returns(address[] memory){
        return Ids[relation.LABEL];
    }

    function Get_IpfsAddress() external view returns(string memory){
        return Ipfs_Address;
    }

    function Get_Name() external view returns (string memory){
        return Name;
    }

    function Get_IsValue() external view returns(bool){
        return IsValue;
    }

    function Get_CarbonFootprint() external  view returns(uint){
        return CarbonFootprint;
    }

    // endregion getter functions

}

contracts/Handshaker.sol.content:
// SPDX-License-Identifier: GPL-3.0-or-later
pragma solidity 0.8.18;
import "./Ownable.sol";

enum relation { NONE, PREDECESSOR, SUCCESSOR, LABEL, PRODUCT }

contract Handshaker is Ownable{

    function reverseRelation(relation r) public pure returns(relation){
        uint relation_int = uint(r);
        if (relation_int%2 == 0){ // if even
            return relation(relation_int - 1);
        }
        else{
            return relation(relation_int + 1);
        }
    }

    address Owner;

    mapping(address => relation) public Candidates;
    mapping(relation => address[]) public Ids;

    function Get_Owner() external view returns(address owner){
        return Owner;
    }

    function Get_Ids(relation r) external view returns(address[] memory){
        return Ids[r];
    }

    function Add_Candidate(address addr, relation r) external{
            Candidates[addr] = r;
    }

    // region handshake
    function Has_Candidate(address candidateAddress, relation r) public view returns(bool){
        return Candidates[candidateAddress] == r;
    }

    function Accept_Candidate(relation r) public {
        require(Candidates[msg.sender] == reverseRelation(r), "Requestor is not a candidate.");
        Candidates[msg.sender] = relation.NONE;
        Ids[reverseRelation(r)].push(msg.sender);
    }

    function Do_Handshake(address Address, relation r) public returns(bool){
        Handshaker handshaker = Handshaker(Address);

        if(handshaker.Candidates(address(this)) == reverseRelation(r)){
            Ids[r].push(Address);
            handshaker.Accept_Candidate(r);

            return true;
        }
        else{
            Candidates[Address] = r;

            return false;
        }
    }

    function Delete_Id(relation r, uint index) public {
        delete Ids[r][index];
    }

    // end region handshake
}

contracts/Ownable.sol.content:
// SPDX-License-Identifier: GPL-3.0-or-later
pragma solidity 0.8.18;

contract Ownable {
    address public owner;

    constructor() {
        owner = msg.sender;
    }

    modifier onlyOwner {
        require(msg.sender == owner, 'caller must be owner');
        _;
    }

    function ChangeOwnership(address newOwner) public  onlyOwner{
        owner = newOwner;
    }
}

